import React, { useEffect, useState } from "react";
import axios from "axios";
import { Link } from 'react-router-dom';
import CardItemList from './CardItemList';

export default function List() {

  const [data, setData] = useState([]);
  
  useEffect(() => {
    axios
        .get('https://ghibliapi.herokuapp.com/films')
        .then((res) => {
            console.log(res.data);
            setData(res.data);
            
        })
        .catch((err) => {
            console.log(err);
        }); 
}, []);

      return (

    <section className="section-card">
     <div className='cards'>
      <h1>GunMa</h1>
      <div className='cards__container'>

        <div className='cards__wrapper'>
          

        { data.map(data=>
       
      <ul className='cardList__items'>
            <CardItemList
              src='images/paid.png'
              text='One of the features that GunMA has is paid unpaid which will display companies that pay internally, so that users are expected to be able to choose the company according to their needs.'
              label={data.programName}
              path='/'
            />
         
         
          </ul>
        
              
            )}
         
          </div>
    </div>
    </div>
    </section>
  );
}
